import React from 'react';
import { 
  EmptyCartContainer, 
  CartLogoComponent,
  EmptyTitle,
  EmptySubtitle
 } from './cart-container.styles';


const CartContainer = ({ searchBar }) => {
  return (
    searchBar.length()
    ? 
    <EmptyCartContainer>
      <CartLogoComponent/>
      <EmptyTitle>
        Your cart is empty
      </EmptyTitle>
      <EmptySubtitle>
        Seems like you haven't chosen what to buy...
      </EmptySubtitle>
    </EmptyCartContainer>
    :
    <>
    </>
  )
}

export default CartContainer;
